import { Component } from 'react';
import Room from './Room';
import axios from 'axios';


export default class Rooms extends Component {


    constructor(props) {
        super(props);
        this.state = { rooms: [] }
    }
    componentDidMount(){
        const requestOptions = {
            method:'POST',
            headers:{'Content-Type':'application/json'},
            body: JSON.stringify({email:'f13'})
        };
        fetch("https://localhost:8000/getJoin",requestOptions)
        .then(res=>res.json())
        
    }

    render() {
        return (
            <div className="row" >
                {this.state.rooms.map(room => {
                    return (
                        <Room
                            code={room}
                        >
                        </Room>
                    )
                })}
            </div>
        )
    }
}
